2015-09-03 作为 HTTP 服务器，在本地运行一些 Web 应用还是挺不错的 安装 brew install nginx 开机启动 ln -sfv /usr/local/opt/nginx/*.plist ~/Library/LaunchAgents 运行 launchctl load ~/Library/LaunchAgents/homebrew.mxcl.nginx.plist 或者 nginx 配置 mvim /usr/local/etc/nginx/nginx.conf 下面我简单举个配置虚拟主机的例子，也可以看配置文件中自带的 server 的例子 在 http { } { } 内加入如下代码： # aria2-mac
server { # 监听端口为 8080 listen 8080; # 主机名字，可以多个 server_name aria2-mac.dreamxu.com; # 默认首页文件，可以多个 index index.html; # 网站目录 root path/aria2-mac.dreamxu.com;
} 以上配置我用来运行一个 aria2 下载工具的图形前端 webui-aria2 然后编辑 /etc/hosts 文件，加入 127.0.0.1 aria2-mac.dreamxu.com 以后访问应用只需要在浏览器中输入 aria2-mac.dreamxu.com:8080
